import React from 'react'

const ContactCard = ({contactDataProps}) => {
    console.log(contactDataProps);
    return (
        <>
             <section id="Contact">
                <div className="bg-dark text-secondary p-5">
                <h1 className="p-5 bg-dark text-light text-center">Contact Me</h1>

                <div className="row">
<div className="col-sm-4">
        {contactDataProps.map((curElem)=>{


       return(
<div className="column">
    <div className="contact-box text-secondary mb-3">
        <span><h6 className="p-5">{curElem.icon}&nbsp; &nbsp;{curElem.cName} {curElem.Cdescription}</h6></span>
    </div>

 

    
</div>
)
}
)}
</div>




<div className="col-sm-8">
<form className="">
<label className="form-label ">Name</label>
     <input className="form-control-sm border-0 bg-transparent" name="Name" id="" placeholder="Enter Your name" />


    </form>
    </div>
    </div>
    </div>
            </section> 
        </>
    )
}

export default ContactCard
